import Fresh, { Element } from '../../index.js';
// const Element = Fresh.Element;

class Header extends Fresh.Element {
    constructor() {
        super({el: { type: 'header', classes: 'app-header' }}, '');
        this.store = {};
    }

    template() {
        return (
            <header className='app-header'>
                <h1>A JSX Header!</h1>
            </header>
        );
    }
}


export default Header;
